import React from "react";
import label from "../label";

const HomeComponent = ({
  handleNewEntry,
  challenges
}) => {
  return (
    <div className="w-100 h-100">
      <div className="h-5 text-white align-items-center justify-content-center d-flex bg-primary">
        {label.HACK_IDEAS}
      </div>
      <div className="h-10 row mx-0 align-content-center justify-content-end p-2">
        <button
          type="button"
          className="btn btn-primary w-25"
          onClick={() => handleNewEntry()}
        >
          {label.ADD_IDEAS_CHALLENGES}
        </button>
      </div>
      <div className="h-85 w-100">
        {challenges?.length > 0 ? challenges.map((item) => {
          return (
            <div>
              {item.title}
            </div>
          );
        }) : <div className="fs-1 row mx-0 align-items-center jsutext-danger fw-bold text-center">{label.NO_RECORDS_FOUND}</div>}
      </div>
    </div>
  );
};

export default HomeComponent;
